import React from 'react'

export default function Calendar(props) {
  let noEarlier = Number(props.nE.substring(2, 6));
  let noLater = Number(props.nL.substring(2, 6));
  let totalHours = (noLater - noEarlier) / 100;
  let numTimeSegs = totalHours * 4;
  const rows = [];
  for (let i = 0; i < numTimeSegs; i++) {
    let inc = 0;
    if (i >= 4) {
      inc = Math.floor(i / 4) * 100;
      inc += (i % 4) * 15;
    }
    else {
      inc = i * 15;
    }
    rows.push(tableRow(inc + noEarlier));
  }

  return (
    <div className='calendar'>
      <table>
        <thead>
          <tr>
            <th>Sunday</th>
            <th>Monday</th>
            <th>Tuesday</th>
            <th>Wednesday</th>
            <th>Thursday</th>
            <th>Friday</th>
            <th>Saturday</th>
          </tr>
        </thead>
        <tbody>
          {rows}
        </tbody>
      </table>
    </div>
  )
}

function tableRow(time) { 
  let timeStr = String(time).slice(0,2) + ':' + String(time).slice(2,4);
  return (
    <tr id={time}>
      <td id='0'> </td>
      <td id='0'> </td>
      <td id='0'> </td>
      <td id='0'> </td>
      <td id='0'> </td>
      <td id='0'> </td>
      <td id='0'> </td>
    </tr> 
  );
}
